import { HttpClientModule } from '@angular/common/http';
import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { UnsplashConfig, UNSPLASH_CONFIG } from '@berry-cloud/ngx-unsplash';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { MuraLComponent } from './mural/mural.component';
import { UnsplashComponent } from './unsplash/unsplash.component';

@NgModule({
  declarations: [
    AppComponent,
    MuraLComponent,
    UnsplashComponent
  ],
  imports: [
    BrowserModule,
    HttpClientModule,
    AppRoutingModule,
  ],
  providers: [{provide: UNSPLASH_CONFIG,
    useValue: {
      url: 'https://api.unsplash.com/photos/?',
      authorization: 'Client-ID -O8SGnISSCI_73fl7wYRn10q-4gPM6y4y4CpooVW8ag',
    } as UnsplashConfig,
  },],
  bootstrap: [AppComponent]
})
export class AppModule { }
